import obj1 from "./objects";
import React from "react";
import useCollapse from "react-collapsed";
import "./ViewResource.css";
function InnerCollapsible() {
  const { getCollapseProps, getToggleProps, isExpanded } = useCollapse();
  return (
    <div className="collapsible">
      <div className="header" {...getToggleProps()}>
        {isExpanded ? "Collapse" : "Expand"}
      </div>
      <div {...getCollapseProps()}>
        <div className="content">
          Now you can see the hidden content. <br />
          <br />
          Click <i>Collapse</i> to hide this content...
        </div>
      </div>
    </div>
  );
}
function Collapsible() {
  const { getCollapseProps, getToggleProps, isExpanded } = useCollapse();
  return (
    <div className="collapsible">
      <div className="header" {...getToggleProps()}>
        {isExpanded ? "Close" : "Open"}
      </div>
      <div {...getCollapseProps()}>
        <div className="content">
          Now you can see the hidden content. <br />
          <br />
          Click <i>Close</i> to hide everything... <br />
          <br />
          <InnerCollapsible />
        </div>
      </div>
    </div>
  );
}
function ViewResource() {
  return (
    <>
      <h1>Resources</h1>
      <div className="collapsible">
        <div className="header" {...getToggleProps()}>
          <ul>
            {Object.keys(obj1).map((p) => (
              <div>
                <li>{isExpanded ? "Close" : { p }}</li>
                {console.log(p)}
                {Object.keys(obj1[p]).map((n) => (
                  <ul>
                    <li>{n}</li>
                    <ul>
                      {console.log(n, obj1[p][n])}
                      {obj1[p][n].map((k) => (
                        <li>{k}</li>
                      ))}
                    </ul>
                  </ul>
                ))}
              </div>
            ))}
          </ul>
        </div>
      </div>

      <Collapsible />
    </>
  );
}

export default ViewResource;
